package fr.niware.zombie.game.arena;

public enum ZombieNPC {

    SPAWN(1,
            "§eYou will be teleported to entrance of §ccatacombs of hell",
            "",
            ""
    ),
    CATACOMBS(2,
            "§6Are you sure you want to go to the depths of the catacombs of §cthe dead",
            "",
            ""
    ),
    BLEACHERS(3,
            "§aClick to join the queue",
            "",
            ""
    );

    private final int id;
    private final String name;
    private final String texture;
    private final String signature;

    ZombieNPC(int id, String name, String texture, String signature) {
        this.id = id;
        this.name = name;
        this.texture = texture;
        this.signature = signature;
    }

    public int getId() {
        return this.id;
    }

    public String getName() {
        return this.name;
    }

    public String getTexture() {
        return this.texture;
    }

    public String getSignature() {
        return this.signature;
    }
}
